', '-', 'Abstract Syntax Notation 1 (ASN.1)是一种数据处理标准，它已被许多应用
程序用来处理不同平台间的数据正规化处理与互通。ASN.1 是一种用以定义数
据标准的语言，也就是说，数据处理的标准可用 ASN.1 撰写。
 在 Microsoft 实现 ASN.1 时，存在一个漏洞(缓冲区溢出)，导致可让攻击
者远程取得系统 System 帐号权限，造成攻击者得以掌握受害系统。若要使攻
击成功，攻击者需要使受害系统解析有问题的 ASN.1 数据，例如，若有以 ASN.1
为基础的验证协议，则攻击者可能经由传送恶意的验证要求以期成功入侵系
统。
 微软在安全公告 MS04-007 中描述 ASN.1 库中存在多个堆溢出漏洞，可能
影响所有利用这个库的系统和应用程序，目前已经知道此漏洞影响 Windows 
NT/2000/XP 系统，攻击者利用这个漏洞可能远程入侵并完全控制服务器或者
客户端系统，因此微软已经将此漏洞列为紧急级别，需要 Windows 用户立刻进
行升级或处理。
 微软还把 ASN.1 应用到了多个网络服务上，如 IIS。因此造成这些网络服
务存在漏洞。
