', '-', 'MS RPC 是 windows 操作系统使用的一种远程过程调用协议，rpc 提供进
程间交互通信机制，允许在某台计算机上运行程序的无缝地在远程系统上执行
代码。协议本身源自开放软件基金会的 DCE RPC 协议，微软在其基础上增加
了自己的一些扩展。
 微软 Windows NT 4.0, 2000, XP, 及 Server 2003 的 RPC(远程过程调用)某
个 DCOM 接口侦听 TCP/UDP 135 端口，它存在缓冲区溢出漏洞。这是由于对
客户端 DCOM 事件激活请求没有进行严格的边界检测造成的，漏洞会导致本
地系统权限执行恶意指令。
 攻击者可以通过 135、137、138、139、445、593 端口进行攻击。
 对于启动了 com internet 服务和 rpc over http 的用户来说，攻击者还可能通
过 80 和 443 端口进行攻击。
', '1.临时解决方法：
 (1)使用防火墙阻止以下端口的网络通信（包括 TCP 和 UDP）：
 135、136、137、138、139、445、593
 (2)禁止使用 RPC over HTTP，具体方法请参考：
http://support.microsoft.com/default.aspx?scid=kb;zh-cn;825819#XSLTH4144121121120121120120
2.最终解决方案：
 微软为这个漏洞发布了安全公告，其中含有补丁的下载地址：
http://www.microsoft.com/china/technet/security/bulletin/MS03-039.mspx
', '14', '分数:10 信息:AV:N/AC:L/Au:N/C:C/I:C/A:C', ' ');
份验证和 Active Directory 进程的接口。它处理客户端和服务器的身份验证。
它还包含一些用于支持 Active Directory 实用程序的功能。
 LSASS DCE/RPC 末端导出的 Microsoft 活动目录服务存在一个缓冲区溢
出，远程攻击者可以利用这个漏洞以 SYSTEM 权限在系统上执行任意指令。
 一些活动目录服务在 Windows 目录中在"debug"子目录里生成调试日志文
件，在 LSASRV.DLL 实现的记录函数写信息条目到日志文件中，这里的
vsprintf()函数用于建立日志条目。由于对提供给这个函数的字符串参数缺少正
确的边界缓冲区检查，超长字符串可导致缓冲区溢出。部分 RPC 函数接收此
字符串作为参数并尝试写调试日志文件，利用这些 RPC 函数，可能以 SYSTEM
权限在系统上执行任意指令。
', '1.临时解决方法：
 用防火墙或 TCP/IP 端口筛选程序阻止对 135 136 137 138 139 445 端口的访
