-- ----------------------------
-- Function structure for GET_UUID
-- ----------------------------
CREATE OR REPLACE
FUNCTION "TJM"."GET_UUID" AS
BEGIN
guid := lower(RAWTOHEX(sys_guid()));
RETURN
substr(guid,1,8)||'-'||substr(guid,9,4)||'-'||substr(guid,13,4)||'-'||substr(guid,17,4)||'-'||substr(guid,21,12);
END get_uuid;
/

